a {
    color: #90555b;
}

#top_nav {
    background: url("http://cs414621.vk.me/u270243789/docs/1d92a49cd1ec/header.jpg");
    border-radius: 0 0 25px 25px;
}

#top_logo_down {
     background: none;
}
